import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Locate the search input field by its placeholder and fill it
    const searchInput = page.getByPlaceholder('Search Amazon');
    await searchInput.waitFor({ state: 'visible', timeout: 5000 });
    await searchInput.fill('iPhone');

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_text_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_text_entered.png'));

    // 2. Locate the search button and click it
    // There are multiple buttons with the same class, so we select the first one.
    const searchButton = page.locator('.search-btn').first();
    await searchButton.waitFor({ state: 'visible', timeout: 5000 });
    await searchButton.click();

    // 3. Wait for the search results to be displayed and take a screenshot
    // The JavaScript on the page will update the content.
    const resultsHeader = page.locator('h2:has-text("Search Results for \\"iPhone\\"")');
    await resultsHeader.waitFor({ state: 'visible', timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // 4. Extract data to verify the action
    const resultsHeaderText = await resultsHeader.textContent();
    const resultsCount = await page.locator('.results-count').textContent();

    return {
      success: true,
      action: "Searched for 'iPhone' and verified search results page.",
      extractedData: {
        searchResultTitle: resultsHeaderText.trim(),
        numberOfResults: resultsCount.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // If any step fails, capture the error
    const errorScreenshotPath = path.join(screenshotsDir, 'error.png');
    await page.screenshot({ path: errorScreenshotPath });
    return {
      success: false,
      action: "Failed to search for 'iPhone' products.",
      extractedData: {},
      screenshots: [errorScreenshotPath],
      error: error.message
    };
  }
}
